import React from 'react';
import './header.css';

const defaultProfPic5 = require('./logo.png')

const Header = ({logopic}) =>
    <div id="header">
        <div id="headerlogo">
            <img id="logoimg" src={logopic}/>
        </div>
    </div>;

Home.defaultProps = {
    logopic:defaultProfPic5,
}

export default Header;
